import React from 'react';
import data from '../data.json';

const CardSection = () => {
  return (
    <section>
      {data.map((card, index) => (
        <div key={index}>
          <h3>{card.title}</h3>
          <p>{card.description}</p>
        </div>
      ))}
    </section>
  );
};

export default CardSection;
